import React, { Component } from "react";
import { Link } from "react-router-dom";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import platzhalter from './platzhalter.png';

class Navbar extends Component {
  render() {
    return (
      <div className="navbar-fixed">
        <nav className="z-depth-0">
          <div>
              <img src={platzhalter} alt="Platzhalter" />
          </div>
          <div className="nav-wrapper white">
              <Row>
                  <Col>
                      <Link
                          to="/login"
                          style={{
                              width: "140px",
                              borderRadius: "3px",
                              letterSpacing: "1.5px"
                          }}
                          className="btn btn-large btn-flat waves-effect white black-text"
                      >
                          Log In
                      </Link>
                  </Col>
                  <Col>
                      <Link
                          to="/login"
                          style={{
                              width: "140px",
                              borderRadius: "3px",
                              letterSpacing: "1.5px"
                          }}
                          className="btn btn-large btn-flat waves-effect white black-text"
                      >
                          Log In
                      </Link>
                  </Col>
                  <Col>
                      <Link
                          to="/login"
                          style={{
                              width: "140px",
                              borderRadius: "3px",
                              letterSpacing: "1.5px"
                          }}
                          className="btn btn-large btn-flat waves-effect white black-text"
                      >
                          Log In
                      </Link>
                  </Col>
                  <Col>
                      <Link
                          to="/login"
                          style={{
                              width: "140px",
                              borderRadius: "3px",
                              letterSpacing: "1.5px"
                          }}
                          className="btn btn-large btn-flat waves-effect white black-text"
                      >
                          Log In
                      </Link>
                  </Col>
                  <Col>
                      <Link
                          to="/login"
                          style={{
                              width: "140px",
                              borderRadius: "3px",
                              letterSpacing: "1.5px"
                          }}
                          className="btn btn-large btn-flat waves-effect white black-text"
                      >
                          Log In
                      </Link>
                  </Col>
              </Row>

            <Link
                to="/login"
                style={{
                  width: "140px",
                  borderRadius: "3px",
                  letterSpacing: "1.5px"
                }}
                className="btn btn-large btn-flat waves-effect white center-right black-text"
            >
              Log In
            </Link>
          </div>
        </nav>
      </div>
    );
  }
}
export default Navbar;
